import React, { useState } from 'react'
import './Home.scss'
import { Link } from 'react-router-dom'
import Animation from '../Animation/Animation'

const Home = () => {
    const [letterClass, setLetterClass] = useState('text-animate')

    const array1 = ['H', 'i', ',']
    const array2 = ['I', '\'', 'm', ' ', 'R', 'a', 'j', 'a', 't']
    const array3 = ['f', 'r', 'o', 'n']

    return (
        <div className='home container'>
            <div className='title'>
                <span className='tag'>&lt;h1&gt;</span>
                <h1>
                    <Animation
                        letterClass={letterClass}
                        strArray={array1}
                        index={0}
                    /><br />
                    <Animation
                        letterClass={letterClass}
                        strArray={array2}
                        index={0}
                    /><br />
                    <Animation
                        letterClass={letterClass}
                        strArray={array3}
                        index={0}
                    /><br />
                </h1>
                <span className='tag'>&lt;/h1&gt;</span>
                <p>Web Developer / Full Stack Developer / Freelancer</p>
                <div className='buttons'>
                    <Link exact='true' to='/'>RESUME</Link>
                    <Link exact='true' to='/contact'>CONTACT ME</Link>
                </div>
            </div>
        </div>
    )
}

export default Home
